'use strict';

var _             = require('lodash');
var del           = require('del');
var browserSync   = require('browser-sync');
var gulp          = require('gulp');
var $             = require('gulp-load-plugins')();
var webpack       = require('webpack-stream');
var argv          = require('yargs').argv;
var runSequence   = require('run-sequence');
var webpackConfig = require('./webpack.config.js')();

// -------------------------------------------
// Configuration
// -------------------------------------------

var paths = {
  src      : __dirname + '/src',
  dist     : __dirname + '/dist',
  examples : __dirname + '/examples',
  bower    : __dirname + '/examples/bower_components'
};

var patterns = {
  js : paths.src + '/**/*.js'
};

gulp.task('clean', function () {
  return del([
    paths.dist + '/**/*',
    paths.examples + '/dist/**/*'
  ]);
});

gulp.task('webpack', function() {
  return gulp.src(paths.src + '/main.js')
    .pipe(webpack(_.extend(webpackConfig, {
      output: {
        filename: 'labella.js',
        sourceMapFilename: '[file].map',
        library: 'labella',
        libraryTarget: 'umd',
        umdNamedDefine: false
      },
      devtool: argv.debug ? 'eval' : undefined
    })))
    .pipe(gulp.dest(paths.dist))
    .pipe(gulp.dest(paths.examples+'/dist'))
    .pipe($.uglify({
      report: 'min',
      mangle: true,
      compress: true, //true,
      preserveComments: false
    }))
    .pipe($.rename({
      suffix: '.min'
    }))
    .pipe(gulp.dest(paths.dist))
    .pipe(gulp.dest(paths.examples+'/dist'));
});

gulp.task('webpack-extra', function() {
  return gulp.src(paths.src + '/extra.js')
    .pipe(webpack(_.extend(webpackConfig, {
      output: {
        filename: 'labella-extra.js',
        sourceMapFilename: '[file].map',
        library: 'labella',
        libraryTarget: 'umd',
        umdNamedDefine: false
      },
      devtool: argv.debug ? 'eval' : undefined
    })))
    .pipe(gulp.dest(paths.dist))
    .pipe(gulp.dest(paths.examples+'/dist'))
    .pipe($.uglify({
      report: 'min',
      mangle: true,
      compress: true, //true,
      preserveComments: false
    }))
    .pipe($.rename({
      suffix: '.min'
    }))
    .pipe(gulp.dest(paths.dist))
    .pipe(gulp.dest(paths.examples+'/dist'));
});

/* Start browser-sync */
gulp.task('browser-sync', ['build'], function() {
  browserSync.init({
    server: './examples',
    files: ['examples/**/*.*'],
    browser: 'google chrome',
    port: 7000,
  });
});

var buildTasks = [];

/* Build everything */
gulp.task('build', function(done){
  runSequence('clean', buildTasks.concat(['webpack', 'webpack-extra']), done);
});

/* Watch for individual file changes and build as needed */
gulp.task('watch', ['build'], function(){
  buildTasks.forEach(function(task){
    gulp.watch(patterns[task], [task]);
  });

  gulp.watch(patterns.js, ['webpack']);
});

gulp.task('run', ['watch', 'browser-sync']);
gulp.task('default', ['run']);

/* Deployment */
gulp.task('gh-pages', ['build'], function() {
  return gulp.src(paths.examples + '/**/*')
    .pipe($.ghPages());
});

// Karma configuration
'use strict';

var webpackConfig = require('./webpack.config.js')();

webpackConfig.module.postLoaders = [
  // instrument only source files with Istanbul
  {
    test: /\/[A-Za-z0-9_\-\/]+(?!\.spec)\.js$/,
    loader: 'istanbul-instrumenter'
  }
];
webpackConfig.devtool = 'inline-source-map';

module.exports = function(config) {
  config.set({

    // base path that will be used to resolve all patterns (eg. files, exclude)
    basePath: '.',

    // frameworks to use
    // available frameworks: https://npmjs.org/browse/keyword/karma-adapter
    frameworks: ['jasmine'],

    // each file acts as entry point for the webpack configuration
    files: [
      // all files ending in ".spec.js"
      'src/**/*.spec.js'
    ],

    // preprocess matching files before serving them to the browser
    // available preprocessors: https://npmjs.org/browse/keyword/karma-preprocessor
    preprocessors: {
      'src/**/*.spec.js': ['webpack', 'sourcemap']
    },

    webpack: webpackConfig,

    // test results reporter to use
    // possible values: 'dots', 'progress', 'mocha', 'coverage'
    // available reporters: https://npmjs.org/browse/keyword/karma-reporter
    reporters: ['spec', 'coverage'],

    // web server port
    port: 9876,

    // enable / disable colors in the output (reporters and logs)
    colors: true,

    // level of logging
    // possible values: config.LOG_DISABLE || config.LOG_ERROR || config.LOG_WARN || config.LOG_INFO || config.LOG_DEBUG
    logLevel: config.LOG_INFO,

    // // enable / disable watching file and executing tests whenever any file changes
    // autoWatch: true,

    // start these browsers
    // available browser launchers: https://npmjs.org/browse/keyword/karma-launcher
    browsers: [
      'PhantomJS',
      // 'Chrome',
      // 'Firefox'
    ]

  });
};

var webpack = require('webpack');
var fs = require('fs');

var bowerPath = 'bower_components';
try{
  if(fs.statSync(__dirname + '/.bowerrc')){
    var bowerrc = JSON.parse(fs.readFileSync(__dirname + '/.bowerrc', 'utf-8'));
    if(bowerrc.directory){
      bowerPath = __dirname + '/' + bowerrc.directory;
    }
  }
}
catch(ex){}

module.exports = function(){
  return {
    module:{
      loaders: [
        {
          test: /\.json$/,
          loader: 'json-loader'
        },
        {
          test: /\.jsx?$/,
          exclude: /(node_modules|bower_components)/,
          loader: 'babel', // 'babel-loader' is also a legal name to reference
          query: {
            presets: ['es2015']
          }
        }
      ],
    },
    resolve: {
      modulesDirectories: [bowerPath]
    },
    plugins: [
      new webpack.ResolverPlugin(
        new webpack.ResolverPlugin.DirectoryDescriptionFilePlugin('bower.json', ['main'])
      )
    ]
  };
};
